import { Fragment } from "react";
import { Button, Card, CardBody, CardTitle, Row, Table } from "reactstrap";
import { Colxx } from "../../common/CustomBootstrap";
import IconCard from "../../forms/IconCard";
import * as TiIcons from 'react-icons/ti';
import ReactTableAdvancedCard from "../../forms/Tables";



function ListUsers() {



    const data = [{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      },{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      },{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      },{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      },{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      },{
        name: 'Tanner Linsley',
        age: 26,
        friend: {
          name: 'Jason Maurer',
          age: 23,
        },
      }];
     
      const columns = [{
        Header: 'Name',
        accessor: 'name' // String-based value accessors!
      }, {
        Header: 'Age',
        accessor: 'age',
        Cell: props => <span className='number'>{props.value}</span> // Custom cell components!
      }, {
        id: 'friendName', // Required because our accessor is not a string
        Header: 'Friend Name',
        accessor: d => d.friend.name // Custom value accessors!
      }, {
        Header: props => <span>Friend Age</span>, // Custom header components!
        accessor: 'friend.age'
      }]
    


    return (
        <Fragment>

            <Row style={{ marginTop: 20,alignItems:"center",display:"flex",justifyContent:"center" }}>

                <Colxx xxs="6" sm="4" md="3" lg="2">
                    <IconCard title="utilisateurs" icon={<TiIcons.TiArrowRepeat style={{ width: 50, height: 50, color: "purple" }} />} value="20" className="mb-4" />
                </Colxx>

                <Colxx xxs="6" sm="4" md="3" lg="2">
                    <IconCard title="utilisateurs" icon={<TiIcons.TiArrowRepeat style={{ width: 50, height: 50, color: "purple" }} />} value="20" className="mb-4" />
                </Colxx>

                <Colxx xxs="6" sm="4" md="3" lg="2">
                    <IconCard title="utilisateurs" icon={<TiIcons.TiArrowRepeat style={{ width: 50, height: 50, color: "purple" }} />} value="20" className="mb-4" />
                </Colxx>
            </Row>

            <Row style={{ marginTop: 20,alignItems:"center",display:"flex",justifyContent:"center" }}>
            <Colxx xxs="10">
            <Card  className="mb-4">
              <CardBody>
                <CardTitle>
                 Liste des utilisateurs
                </CardTitle>
                <Table  responsive={true}>
                  <thead>
                    <tr>
                      <th>Id</th>
                      <th>Prénom</th>
                      <th>Nom</th>
                      <th>Email</th>
                      <th>Tél</th>


                      <th>Date de naissance</th>

                      <th>Role</th>

                    </tr>
                  </thead>
                  <tbody>
                  
                    <tr>
                      <th scope="row">2</th>
                      <td>Jacob</td>
                      <td>Thornton</td>
                      <td>@fat</td>
                      <td>@fat</td>
                      <td>@fat</td>
                      <td>Utilisateur</td>
                      <td>    <Button outline color="warning" className="mb-2">
                 Modifier
                </Button>{" "}
           <Button outline color="danger" className="mb-2">
                  Supprimer
                  </Button></td>
                    </tr>
               
                    <tr>
                      <th scope="row">2</th>
                      <td>Jacob</td>
                      <td>Thornton</td>
                      <td>@fat</td>
                      <td>@fat</td>
                      <td>@fat</td>
                      <td>Utilisateur</td>
                      <td>    <Button outline color="warning" className="mb-2">
                 Modifier
                </Button>{" "}
           <Button outline color="danger" className="mb-2">
                  Supprimer
                  </Button></td>
                    </tr>
              
                  </tbody>
                </Table>
              </CardBody>
            </Card>
          </Colxx>

</Row>



<Row style={{ marginTop: 20,alignItems:"center",display:"flex",justifyContent:"center" }}>

<Colxx xxs="10">
<ReactTableAdvancedCard title="Liste des utilisateurs" data={data} className="mb-10" dataTableColumns1={columns}  />

</Colxx>
</Row>
        </Fragment>
    );
}
export default ListUsers;
